description:
Yes, you can go home again. But first have your nails done. In this third installment of the hugely successful &quot;Brat&quot; series, lovely Jamie leaves Morton once again, and goes back to the house she grew up in. Only now there's a stepfather, stepbrothers and sisters -- a whole houseful of kids. And all those bedrooms...Going home to mother was never like this!

